import './App.css';
import { useState } from 'react';
import {
  MDBInput,
  MDBCheckbox,
  MDBBtn
} from 'mdb-react-ui-kit';


function App() {

  const [prompt, setPrompt] = useState("Bla Bla Bla");
  const [genre, setGenre] = useState("Rock");


  return (

    /*<form>
      <MDBInput id='form4Example1' wrapperClass='mb-4' label='Name' />
      <MDBInput type='email' id='form4Example2' wrapperClass='mb-4' label='Email address' />
      <MDBInput wrapperClass='mb-4' textarea id='form4Example3' rows={4} label='Message' />

      <MDBCheckbox
        wrapperClass='d-flex justify-content-center mb-4'
        id='form4Example4'
        label='Send me a copy of this message'
        defaultChecked
      />

      <MDBBtn type='submit' className='mb-4' block>
        Sign in
      </MDBBtn>
    </form>*/

    <div className="flex justify-center">
      <form>
        <div className='App'>
          <label>Enter prompt: </label>
          <textarea value={prompt} onChange={(e) => { setPrompt(e.target.value) }} />
        </div>
        <div className='App'>
          <select value={genre} onChange={(e) => { setGenre(e.target.value) }}>
            <option value="Rock">Ford</option>
            <option value="Funk" selected>Volvo</option>
            <option value="Jazz">Fiat</option>
          </select>
        </div>
      </form>
    </div>
  );
}

export default App;
